    {"name":"Grilled Corn Salad","body":"\n\t\t\n\t\t\t<p><strong>What You Need</strong></p><ul><li>3/4 cup <strong>KRAFT Zesty Italian Dressing</strong>, divided</li><li>1/4 cup  yellow mustard</li><li>4 ears corn on the cob, husks and silk removed</li><li>1/2 lb.  fresh green beans, trimmed, quartered and cooked</li><li>1 jicama, peeled, cut into 1/2-inch cubes</li><li>2   tomatoes, cut into wedges</li><li>1/2 cup chopped fresh basil</li></ul><strong>Make It</strong><p><strong>HEAT </strong>grill to low heat.</p><p><strong>MIX </strong>1/4 cup dressing and mustard in shallow dish until well blended. Add corn; turn to evenly coat. Transfer corn to grill; reserve dressing mixture.</p><p><strong>GRILL </strong>corn 15 to 20 min. or until tender, turning and brushing occasionally with reserved dressing mixture. Remove corn from grill; cool. Cut corn from cobs; place in large bowl.</p><p><strong>ADD </strong>beans, jicama, tomatoes, basil and remaining dressing; mix well.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Make Ahead\u00a0</strong>Prepare salad as directed but do not add basil. Refrigerate up to 24 hours. Toss with basil just before serving.</p><p><strong>How to Remove Corn Kernels from the Cob</strong><br />Cut off the tip from the cob to flatten the end. Stand the cob upright on the flat end. Using a very sharp knife, cut downward, removing 3 or 4 rows of corn at a time.</p><p><strong>Substitute\u00a0</strong>For a flavor boost, substitute<strong> GREY POUPON Dijon Mustard</strong> for the yellow mustard.</p>\n\t\t\n\t\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n \n","id":"text-asset-3207","type":"text-asset","createdAt":1303143658,"contexts":[{"type":"image","node":"node-1857","id":"image-3827"}]},
    {"name":"Cheesy Chickan Fajitas","body":"<p></p><p>Cheesy Chicken Fajitas\u00a0</p><p><strong>What You Need</strong></p><ul><li>1/2 lb. boneless skinless chicken breasts, cut into thin strips</li><li>1 clove garlic, minced</li><li>1 green pepper, cut into strips</li><li>1/2 cup sliced onions</li><li>1-1/2 cups\u00a0<strong>KRAFT Mexican Style Finely Shredded Four Cheese</strong></li><li>6 flour tortillas (6 inch), warmed</li></ul><strong>Make It</strong><p><strong>COOK\u00a0</strong>chicken and garlic in large skillet sprayed with cooking spray on medium-high heat 5 min., stirring frequently.</p><p><strong>ADD\u00a0</strong>peppers and onions; cook and stir 4 to 5 min. or until chicken is done and vegetables are crisp-tender.</p><p><strong>SPOON\u00a0</strong>1/4 cup each chicken mixture and cheese down center of each tortilla; fold in sides to enclose filling.<br /><br /><strong>Kraft Kitchens Tips</strong></p><p><strong>Special Extra\u00a0</strong>These fajita wraps are even better when filled with even more ingredients, such as cooked corn, finely chopped tomatoes and/or shredded romaine lettuce.</p><p><strong>Serving Suggestion\u00a0</strong>Serve with\u00a0<strong>TACO BELL\u00ae HOME ORIGINALS\u00ae Thick 'N Chunky Salsa</strong>.</p><p><strong>Substitute\u00a0</strong>Substitute a red pepper for the green pepper</p>","id":"text-asset-3423","type":"text-asset","createdAt":1303744055,"contexts":[{"type":"image","node":"node-1858","id":"image-4044"}]},
    {"name":"Homestyle BBQ Chicken Mac","body":"\n\t\t\n\t\t\t<strong>What You Need</strong><br /><ul><li>1 pkg. (12.6 oz.) <strong>KRAFT HOMESTYLE Macaroni &amp; Cheese Dinner Hearty Four Cheese Sauce</strong></li><li>1 pkg.  (6 oz.) <strong>OSCAR MAYER Deli Fresh Oven Roasted Chicken Breast Cuts</strong></li><li>2 Tbsp. <strong>KRAFT Original Barbecue Sauce</strong></li><li>1 Tbsp.  chopped fresh cilantro</li></ul><strong>Make It</strong><p><strong>PREPARE </strong>Dinner in large saucepan as directed on package except do not top with Bread Crumb Topping.</p><p><strong>ADD </strong>chicken and barbecue sauce; cook and stir 1 min. or until heated through.</p><p><strong>SPRINKLE </strong>with cilantro and crumb topping.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Serving Suggestion\u00a0</strong>Serve with smart sides, such as a crisp mixed green salad and your favorite hot steamed vegetable.</p><p><strong>Substitute\u00a0</strong>Prepare using <strong>KRAFT HOMESTYLE Macaroni &amp; Cheese Classic Cheddar</strong>.</p>\n\t\t\t\n\t\t\t","id":"text-asset-3209","type":"text-asset","createdAt":1303144645,"contexts":[{"type":"image","node":"node-1857","id":"image-3829"}]},
    {"name":"Grilled Potato Salad","body":"<strong>What You Need</strong><ul><li>2 lb. small red potatoes, quartered</li><li>1   red pepper, halved, seeded</li><li>3 green onions</li><li>1 Tbsp.  chopped fresh basil</li><li>1/2 cup <strong>KRAFT Natural Three Cheese Crumbles</strong></li><li>3/4 cup  <strong>KRAFT Zesty Italian Dressing</strong></li></ul><strong>Make It</strong><p><strong>HEAT </strong>grill to medium-high heat.</p><p><strong>COOK </strong>potatoes in boiling water 10 min. or just until tender; drain.</p><p><strong>GRILL </strong>potatoes, peppers and onions 10 min. or just until browned, turning occasionally.</p><p><strong>PLACE </strong>potatoes in bowl. Chop pepper and onions. Add to potatoes with remaining ingredients; mix lightly. Serve warm.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Substitute\u00a0</strong>Substitute 2 tsp. dried basil leaves for the fresh basil.</p>","id":"text-asset-3208","type":"text-asset","createdAt":1303143956,"contexts":[{"type":"image","node":"node-1857","id":"image-3828"}]},
    {"name":"Easy Grilled S'mores","body":"<p></p><p><strong>Easy Grilled S'mores</strong></p><p><strong>What You Need</strong></p><ul><li>4 whole\u00a0<strong>HONEY MAID Honey Grahams</strong>, broken crosswise in half (8 squares)</li><li>4 sheets (12x8-inch each) aluminum foil</li><li>1/2 cup<strong>\u00a0BAKER'S Semi-Sweet Chocolate Chunks</strong></li><li>4<strong>\u00a0JET-PUFFED Marshmallows</strong></li></ul><strong>Make It</strong><p><strong>PREHEAT\u00a0</strong>grill to medium-hot. Center each of 4 of the graham squares on sheet of foil. Top each with 1/4 of the chocolate chunks and 1 marshmallow. Cover with remaining graham squares to make a total of 4 s'mores.</p><p><strong>BRING\u00a0</strong>foil sides up around each s'more, then double fold top and both ends to seal each packet, leaving room for heat circulation inside.</p><p><strong>PLACE\u00a0</strong>on grill; cover. Grill 4 to 5 minutes or until marshmallows are melted.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Size It Up\u00a0</strong>Sweets can add enjoyment to a balanced diet, but choose an appropriate portion.</p><p><strong>Great Substitute\u00a0</strong>For extra chocolate flavor, substitute\u00a0<strong>HONEY MAID Chocolate Grahams</strong>for the Honey Grahams.</p><p><strong>Special Extra\u00a0</strong>Spread the graham squares with a bit of raspberry jam before topping with the remaining ingredients.</p>","id":"text-asset-3426","type":"text-asset","createdAt":1303744338,"contexts":[{"type":"image","node":"node-1858","id":"image-4043"}]},
    {"name":"Pat & Gina's Easy Bacon and Frank BBQ Beans","body":"<strong>What You Need</strong><ul><li>1 onion, chopped</li><li>4 slices  <strong>OSCAR MAYER Bacon</strong>, chopped</li><li>2 cans (16 oz. each) baked beans</li><li>2   <strong>OSCAR MAYER Selects Angus Beef Franks</strong>, sliced</li><li>1/3 cup <strong>KRAFT Original Barbecue Sauce</strong></li><li>2 Tbsp.  brown sugar</li><li>1 tsp. cider vinegar</li><li>1 tsp.  hot pepper sauce</li></ul><strong>Make It</strong><p><strong>COOK </strong>and stir onions and bacon in medium saucepan on medium heat 5 min. or until bacon is browned and onions are tender.</p><p><strong>STIR </strong>in remaining ingredients. Bring to boil; simmer on low heat 15 min., stirring occasionally.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Serving Suggestion\u00a0</strong>Serve with a cold glass of prepared <strong>CRYSTAL LIGHT Iced Tea Drink</strong>.</p><p><strong>Substitute</strong><br />Prepare using your favorite variety of <strong>KRAFT Barbecue Sauce</strong>.</p>","id":"text-asset-3210","type":"text-asset","createdAt":1303145085,"contexts":[{"type":"image","node":"node-1857","id":"image-3830"}]},
    {"name":"Velveeta Ultimate Grilled Cheese","body":"<p></p><p><strong>VELVEETA Ultimate Grilled Cheese\u00a0</strong></p><p><strong>What You Need</strong></p><ul><li>8 slices white bread</li><li>6 oz.\u00a0<strong>VELVEETA Pasteurized Prepared Cheese Product</strong>, sliced</li><li>8 tsp. soft margarine</li></ul><strong>Make It</strong><p><strong>FILL\u00a0</strong>bread slices with\u00a0<strong>VELVEETA\u00a0</strong>to make 4 sandwiches.</p><p><strong>SPREAD\u00a0</strong>outsides of sandwiches with margarine.</p><p><strong>COOK\u00a0</strong>in skillet on medium heat 3 min. on each side or until golden brown on both sides.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Substitute\u00a0</strong>Prepare using\u00a0<strong>VELVEETA 2% Milk Pasteurized Prepared Cheese Product</strong>.</p><p><strong>Variations\u00a0</strong></p><p><em>Grilled Tomato &amp; Jalapeno Cheese Sandwich</em>: Prepare as directed, using\u00a0<strong>VELVEETA Mexican Pasteurized Prepared Cheese Product</strong>\u00a0and adding sliced tomatoes to the sandwich filling.</p><p><em>Jelly Grill</em>: Prepare as directed, spreading 4 bread slices evenly with 1/4 grape jelly before topping with\u00a0<strong>VELVEETA</strong>.\u00a0</p><p><em>Cheesy Ham Grill:</em>\u00a0Prepare as directed, adding 1 pkg. (6 oz.)<strong>\u00a0OSCAR MAYER Honey Ham</strong>\u00a0to the sandwich filling.</p>","id":"text-asset-3424","type":"text-asset","createdAt":1303744125,"contexts":[{"type":"image","node":"node-1858","id":"image-4041"}]},
    {"name":"Hot Rod Dog","body":"<p></p><p><strong>Hot Rod Dog</strong></p><p><strong>What You Need</strong></p><ul><li>1 OSCAR MAYER Beef Frank</li><li>1 hot dog bun, split</li><li>1 OSCAR MAYER Little Wiener</li><li>1 Tbsp. CHEEZ WHIZ Cheese Dip</li><li>1 cherry tomato</li><li>9 small pretzel sticks</li><li>1/2 of a tomato slice</li><li>1 KRAFT Singles</li><li>2 tsp. ketchup</li><li>2 stuffed green olives</li><li>4 CLAUSSEN Kosher Dill Sandwich Slices</li><li>1 RITZ Cracker</li><li>2 green onion slices</li><li>1 pitted black olive slice</li></ul><strong>Make It</strong><p><strong>HEAT\u00a0</strong>frank as directed on package or grill until heated through (160\u00b0F). Place frank in bun to form the lower part of the \"driver's body.\" Place little wiener upright at one end of the frank to form the upper part of the driver's body, using\u00a0<strong>CHEEZ WHIZ</strong>\u00a0to secure pieces. Attach cherry tomato to top of the little wiener with pretzel stick to form the \"driver's head.\"</p><p><strong>PLACE\u00a0</strong>tomato slice upright at one end of sandwich, in front of the driver, to resemble the windshield, attaching to frank with a dab of<strong>CHEEZ WHIZ</strong>. Place Singles over the frank, in front of the windshield, to form the \"hood.\" Decorate with ketchup.</p><p><strong>ADD\u00a0</strong>green olives to front of hood for the \"headlights,\" using 2 of the pretzel sticks, then attach pickle slices with 4 of the pretzel sticks to both sides of the bun for \"wheels.\" Add the cracker for the \"steering wheel.\"</p><p><strong>ATTACH\u00a0</strong>the white parts of the green onion to the driver's head with a dab of\u00a0<strong>CHEEZ WHIZ</strong>\u00a0to resemble the goggles. Attach ripe olive slice, cut in half, to driver's head, using dab of\u00a0<strong>CHEEZ WHIZ</strong>, to form \"smile.\" Cut remaining half of olive slice crosswise in half for the \"eyebrows.\" Attach remaining 2 pretzel sticks to both sides of little weiner for the \"arms.\"</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Serving Suggestion\u00a0</strong>Serve with cut-up fresh fruit.</p><p><strong>Family Fun\u00a0</strong>Let the kids have fun assembling their own Hot Rod Dog.</p>","id":"text-asset-3425","type":"text-asset","createdAt":1303744208,"contexts":[{"type":"image","node":"node-1858","id":"image-4042"}]},
    {"name":"JELL-O\u00ae Beach Dessert ","body":"\t\t\n\t\t\t<p><strong>JELL-O\u00ae Beach Dessert\u00a0</strong></p><p><strong>What You Need</strong></p><ul><li>2-1/4 cups finely crushed <strong>NILLA Wafers</strong>, divided</li><li>1/2 cup  (1 stick) butter or margarine, melted</li><li>1 pkg. (8 oz.) <strong>PHILADELPHIA Cream Cheese</strong>, softened</li><li>1/4 cup  sugar</li><li>1 tub (12 oz.) <strong>COOL WHIP Whipped Topping</strong>, thawed, divided</li><li>1-1/2 cups  boiling water</li><li>1 pkg. (8-serving size) or 2 pkg. (4-serving size each) <strong>JELL-O Berry Blue Flavor Gelatin</strong></li><li>Ice cubes</li><li>3/4 cup cold water</li><li>1/4 cup  blue colored sprinkles</li><li>6 sticks colored chewing gum</li><li>6 pieces  chewy fruit snack roll (2 inch)</li><li>6 miniature paper umbrellas</li><li>2   jawbreakers</li></ul><strong>Make It</strong><p><strong>COMBINE</strong> 2 cups of the wafer crumbs and the butter in 13x9-inch baking dish. Press firmly onto bottom of dish for crust; cover. Set aside. Mix cream cheese and sugar in medium bowl until well blended. Stir in half of the whipped topping. Spread evenly over crust.</p><p><strong>STIR </strong>boiling water into gelatin in medium bowl at least 2 min. until completely dissolved. Add enough ice cubes to cold water to measure 2 cups. Stir into gelatin. Refrigerate 5 min. or until gelatin is slightly thickened. Spoon over cream cheese layer.</p><p><strong>REFRIGERATE </strong>3 hours or until firm. Just before serving, spread remaining whipped topping over gelatin. Sprinkle with wafer crumbs and sprinkles to resemble sand and water. Bend gum into \"s\" shapes to resemble beach chairs; place on \"sand.\" Place fruit roll pieces near chairs to resemble towels. Insert umbrellas into dessert behind the chairs. Place jawbreakers on the sand for the beach balls. Cut dessert into 20 squares to serve. Store leftover dessert in refrigerator.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Size-Wise\u00a0</strong>At 20 servings, this fun recipe is great for a party or classroom celebration!</p><p><strong>Variation\u00a0</strong>To kick the flavor up a notch, prepare with <strong>JELL-O X-Treme Wild Berry Flavor Gelatin</strong>.</p><p><strong>How to Soften Cream Cheese\u00a0</strong>Place completely unwrapped pkg. of cream cheese in microwaveable bowl. Microwave on HIGH 15 sec. or until slightly softened.</p>","id":"text-asset-3215","type":"text-asset","createdAt":1303148472,"contexts":[{"type":"image","node":"node-1858","id":"image-3835"}]},
    {"name":"easy chicken_demo","body":"<strong>    What You Need</strong><ul><li>1/2 cup <strong>KRAFT Original Barbecue Sauce</strong>, divided</li><li>8 small  boneless skinless chicken breast halves (2 lb.)</li></ul><strong>    Make It</strong><p><strong>    POUR </strong>1/4 cup barbecue sauce over chicken in shallow dish; turn to coat both sides of each breast. Refrigerate 1 hour to marinate.</p><p><strong>    HEAT </strong>grill to medium heat. Remove chicken from marinade; discard marinade.</p><p><strong>    GRILL </strong>chicken 5 to 7 min. on each side or until done (165\u00baF), brushing occasionally with remaining barbecue sauce for the last few minutes.</p><p><strong>    Kraft Kitchens Tips</strong></p><p><strong>    Planned Leftovers\u00a0</strong>Cool 4 grilled chicken breasts; place in airtight container. Refrigerate overnight to serve as part of tomorrow's dinner.</p><p><strong>    Make Ahead\u00a0</strong>Chicken can be marinated up to 24 hours before grilling as directed.</p><p><strong>    How to Prevent Food From Sticking to the Grill\u00a0</strong>To prevent food from sticking to the grill, lightly brush the grill grate with vegetable oil before preheating the grill. Or, spray the cold grill grate with cooking spray.</p>","id":"text-asset-2915","type":"text-asset","createdAt":1302722839,"contexts":[{"type":"node","node":"node-1841"}]},
    {"name":"orange bbq chicken_demo","body":"<strong>    What You Need</strong><ul><li>1/2 cup <strong>KRAFT Original Barbecue Sauce</strong></li><li>1/2 tsp.  orange zest</li><li>2 Tbsp. fresh orange juice</li><li>4 small  boneless skinless chicken breast halves (1 lb.)</li><li>1 zucchini, cut lengthwise in half</li><li>1   yellow squash, cut lengthwise in half</li><li>1 red pepper, cut into quarters</li><li>1/4 cup  <strong>KRAFT Zesty Italian Dressing</strong></li></ul><p><strong>    Make It</strong></p><p><strong>HEAT </strong>grill to medium heat.</p><p><strong>    MIX </strong>barbecue sauce, zest and juice until well blended.</p><p><strong>    GRILL </strong>chicken 6 min., turning after 3 min. Brush with half the sauce.</p><p><strong>    ADD </strong>vegetables to grill. Cook chicken and vegetables 9 to 12 min. or until chicken is done (165\u00baF) and vegetables are crisp-tender, turning occasionally and brushing chicken with remaining sauce and vegetables with dressing.</p><p><br /><strong>    Kraft Kitchens Tips</strong></p><p><strong>Special Extra\u00a0</strong>Stir 1/4 tsp. ground ginger into barbecue sauce mixture before using as directed.</p><p><strong>    Creative Leftovers\u00a0</strong>Grill additional chicken and vegetables to use later, sliced, in salads or wrap sandwiches. Refrigerate until ready to use.</p>","id":"text-asset-2929","type":"text-asset","createdAt":1302725359,"contexts":[{"type":"node","node":"node-1842"}]},
    {"name":"chicken kabobs_demo","body":"<strong>    What You Need</strong><ul><li>1 lb. boneless skinless chicken breasts, cut into 1-1/2-inch pieces</li><li>6 cups  assorted cut-up fresh vegetables (red peppers, mushrooms, onions, zucchini)</li><li>1 cup <strong>KRAFT Original Barbecue Sauce</strong>, divided</li></ul><p><strong>Make It</strong></p><p><strong>    HEAT </strong>grill to medium heat.</p><p><strong>    THREAD </strong>chicken onto skewers alternately with vegetables.</p><p><strong>    GRILL </strong>10 to 15 min. or until chicken is done, turning after 8 min. and brushing with 1/2 cup barbecue sauce for the last 5 min.</p><p><strong>    SERVE </strong>with remaining barbecue sauce.</p><p><strong>    Kraft Kitchens Tips</strong></p><p><strong>Use Your Broiler\u00a0</strong>Heat broiler. Assemble kabobs as directed; place on rack of broiler pan. Broil, 6 inches from heat, 10 to 15 min. or until chicken is done, turning occasionally and brushing with 1/2 cup barbecue sauce for the last 10 min. Serve as directed.</p><p><strong>    How to Grill Kabobs\u00a0</strong>The key to making homemade kabobs is to cut the meat and vegetables into equal-size pieces. Insert the kabob pieces on flat-bladed metal skewers as desired. If using wooden skewers, soak skewers in water for 30 min. before using to assemble kabobs to prevent them from burning on the grill. When grilling the kabobs, use long-handled grilling tongs to rotate the kabobs to ensure even cooking on all sides.</p><p><strong>    Variation\u00a0</strong>Substitute 1 pkg. (14 oz.) <strong>OSCAR MAYER Turkey Smoked Sausage</strong>, cut into 1-inch pieces, for the chicken. Grill 18 min. or until turkey sausage is heated through and vegetables are crisp-tender, turning occasionally and brushing with 1/2 cup barbecue sauce for the last 10 min. Serve as directed.</p>","id":"text-asset-2933","type":"text-asset","createdAt":1302726102,"contexts":[{"type":"node","node":"node-1843"}]},
    {"name":"fajitas_demo","body":"<strong>    What You Need</strong><ul><li>1 lb. boneless skinless chicken breasts, cut into strips</li><li>1   each green and red pepper, cut into strips</li><li>1 onion, cut into thin wedges</li><li>1/2 cup  <strong>KRAFT Original Barbecue Sauce</strong></li><li>8 flour tortillas (6 inch), warmed</li><li>1 cup  <strong>KRAFT Mexican Style Finely Shredded Four Cheese</strong></li><li>1/2 cup <strong>TACO BELL\u00ae HOME ORIGINALS\u00ae Thick 'N Chunky Salsa</strong></li><li>1/4 cup  <strong>BREAKSTONE'S or KNUDSEN Sour Cream</strong></li></ul><strong>    Make It</strong><p><strong>    HEAT </strong>grill to medium-high heat.</p><p><strong>    COMBINE </strong>chicken, vegetables and barbecue sauce. Let stand 5 min. Poke holes evenly in bottom of 13x9-inch disposable foil roasting pan with fork or skewer. Place chicken mixture in pan; place pan on grate of grill. Cover grill with lid.</p><p><strong>    GRILL </strong>chicken and vegetables 20 min. or until chicken is done and vegetables are crisp-tender, stirring occasionally.</p><p><strong>    SPOON </strong>onto tortillas; top with remaining ingredients. Roll up.</p><p><strong>    Kraft Kitchens Tips<br /></strong></p><p><strong>Shortcut\u00a0</strong>Substitute a stir-fry basket for the foil pan. Reduce grilling time to 7 to 10 min.</p><p><strong>Easy Cleanup\u00a0</strong>Place chicken and vegetables in resealable plastic bag. Pour sauce into bag; seal bag. Use your fingers to massage the bag to evenly distribute the sauce.</p><p><strong>Substitute\u00a0</strong>Prepare using <strong>KRAFT Mexican Style 2% Milk Finely Shredded Four Cheese.</strong></p>","id":"text-asset-2923","type":"text-asset","createdAt":1302724798,"contexts":[{"type":"node","node":"node-1847"}]},
    {"name":"cheese bacon burger_demo","body":"<strong>    What You Need</strong><ul><li>1 lb. ground beef</li><li>1/4 cup  <strong>A.1. Original Steak Sauce</strong>, divided</li><li>4 <strong>KRAFT Singles</strong></li><li>4   hamburger buns</li><li>4 lettuce leaves</li><li>8 slices  <strong>OSCAR MAYER Bacon</strong>, cooked, broken in half</li></ul><p><br /><strong>    Make It</strong></p><p>    HEAT grill to medium-high heat.</p><p>    MIX meat and 2 Tbsp. steak sauce; shape into 8 (1/4-inch-thick) patties. Fold each Singles into quarters; place on 4 patties. Top with remaining patties; pinch edges together to seal.</p><p>    GRILL 5 min. on each side or until done (160\u00baF), placing buns, cut-sides down, on grill grate the last 2 min.</p><p>    FILL buns with lettuce, burgers, remaining steak sauce and bacon.</p><p><br /><strong>    Kraft Kitchens Tips</strong><br />    Special Extra<br />    Cut 1 red pepper into 1/2-inch-wide strips; grill with patties 5 min. on each side or until crisp-tender and lightly charred. Add to sandwiches with bacon.</p><p><br />    Serving Suggestion<br />    Serve with fresh fruit and baked chips to round out the meal.</p>","id":"text-asset-2941","type":"text-asset","createdAt":1302728504,"contexts":[{"type":"node","node":"node-1854"}]},
    {"name":"mini burger_demo","body":"<strong>    What You Need</strong><ul><li>1 lb. lean ground beef</li><li>2 Tbsp.  finely chopped red onions</li><li>4 <strong>KRAFT Singles</strong>, halved</li><li>8   slider buns, toasted</li><li>1/2 cup coleslaw</li><li>4 slices  <strong>OSCAR MAYER Bacon</strong>, cooked, cut in half</li><li>1/3 cup <strong>BULL'S-EYE Memphis Style Barbecue Sauce</strong></li></ul><p><strong>    Make It</strong></p><p>    HEAT grill to medium-high heat.</p><p>    MIX meat and onions; shape into 8 patties.</p><p>    GRILL 3 min. on each side or until done (160\u00baF), topping with Singles for the last minute.</p><p>    FILL buns with burgers and remaining ingredients.</p><p><strong>    Kraft Kitchens Tips</strong><br />    Serving Suggestion<br />    Serve with a cold glass of prepared <strong>CRYSTAL LIGHT Iced Tea</strong>.</p><p>    Substitute<br />    Prepare using your favorite variety of <strong>BULL'S-EYE</strong> or <strong>KRAFT Barbecue Sauce</strong>.</p><p>    Substitute<br />    Prepare using split 3-inch soft dinner rolls.</p>","id":"text-asset-2965","type":"text-asset","createdAt":1302729886,"contexts":[{"type":"node","node":"node-1855"}]},
    {"name":"Just for Kids","body":"<p>Here are some great recipe ideas that will satisfy even the most finicky eaters. \u00a0Fun presentation of these healthy treats will live up your BBQ.</p>","id":"text-asset-3401","type":"text-asset","createdAt":1303503799,"contexts":[{"type":"node","node":"node-1858"}]},
    {"name":"grilled maple salmon_demo","body":"<strong>    What You Need</strong><ul><li>1/4 cup maple-flavored or pancake syrup</li><li>2 Tbsp.  GREY POUPON Hearty Spicy Brown Mustard</li><li>1 tsp. minced garlic</li><li>1/4 tsp.  ground ginger</li><li>1/8 tsp. ground red pepper (cayenne)</li><li>4   salmon fillets (1 lb.)</li><li>1 Tbsp. oil</li></ul><p><strong>Make It</strong></p><p><strong>    MIX </strong>first 5 ingredients. Refrigerate several hours.</p><p><strong>    HEAT </strong>grill to medium-high heat. Brush fish with oil.</p><p><strong>    GRILL </strong>4 min. on each side or until fish flakes easily with fork, brushing frequently with syrup mixture.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>    How to Prepare in Quantity\u00a0</strong>Prepare as directed, using 1-1/2 cups syrup, 3/4 cup mustard, 2 Tbsp. garlic, 1-1/2 tsp. ginger, 3/4 tsp. red pepper, 24 salmon fillets and 6 Tbsp. oil. Makes 24 servings.</p><p><strong>Shortcut\u00a0</strong>Short on time? Use syrup mixture immediately after mixing.</p>","id":"text-asset-2987","type":"text-asset","createdAt":1302731412,"contexts":[{"type":"node","node":"node-1859"}]},
    {"name":"bbq shrimp_demo","body":"<strong>What You Need</strong><ul><li>1/4 cup <strong>KRAFT Balsamic Vinaigrette Dressing</strong>, divided</li><li>1 lb.  uncooked large shrimp, peeled, deveined</li><li>1 small red onion, cut into 1-inch chunks</li><li>1   lemon, cut into 8 wedges</li><li>1/4 cup chopped black olives</li><li>1/4 cup  chopped tomatoes</li></ul><p><strong>Make It</strong></p><p><strong>HEAT </strong>grill to medium-high heat. Reserve 2 Tbsp. dressing. Thread shrimp and onions alternately onto 4 skewers; thread lemon wedges onto ends. Brush with remaining dressing.</p><p><strong>GRILL </strong>6 to 8 min. or until shrimp turn pink, turning occasionally. Meanwhile, mix reserved dressing with olives and tomatoes.</p><p><strong>SERVE </strong>kabobs topped with olive mixture.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Substitute\u00a0</strong>Prepare using <strong>KRAFT Sun Dried Tomato Vinaigrette Dressing</strong>.</p><p><strong>Note\u00a0</strong>If using wooden skewers, soak them in water 30 min. before using to prevent them from burning on the grill.</p>","id":"text-asset-2990","type":"text-asset","createdAt":1302731707,"contexts":[{"type":"node","node":"node-1861"}]},
    {"name":"BBQ Video Text","body":"<p>Discover a variety of Kraft cooking tips, cooking videos and techniques to perfect your recipes!</p>","id":"text-asset-10755","type":"text-asset","createdAt":1318425286,"contexts":[{"type":"node","node":"node-1928"}]},
    {"name":"drink intro_Demo","body":"<p>Kick back and relax on a hot summer day with these refreshing treats!</p>","id":"text-asset-3223","type":"text-asset","createdAt":1303150262,"contexts":[{"type":"node","node":"node-1930"}]},
    {"name":"indian chicken_demo","body":"<p></p><ul><li>1/2 cup <strong>BULL'S-EYE Original Barbecue Sauce</strong></li><li>2 Tbsp.  lemon juice</li><li>1 tsp. garam masala</li><li>1 tsp.  ground cumin</li><li>4 small bone-in chicken breast halves (1-1/2 lb.), skins removed</li></ul><p><strong>MIX </strong>all ingredients except chicken.</p><p><strong>RESERVE </strong>1/4 cup sauce; pour remaining over chicken in shallow dish. Turn chicken to coat both sides of each breast. Refrigerate 2 hours to marinate.</p><p><strong>HEAT </strong>grill to medium heat. Remove chicken from marinade; discard marinade. Grill chicken 24 min. or until done (165\u00b0F), turning after 12 min. and brushing with reserved sauce for the last few minutes.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>SUBSTITUTE\u00a0</strong>Prepare using boneless skinless chicken breast halves. Grill 10 min. on each side or until done (165\u00baF).</p><p><strong>SERVING SUGGESTION</strong> To serve with raita, combine 1/2 cup finely chopped English cucumbers, 1/2 cup plain Greek-style yogurt, 1/4 cup <strong>KRAFT Cucumber Ranch Dressing</strong> and 1 Tbsp. chopped fresh mint.\u00a0</p><p><strong>FOOD FACTS</strong> Garam masala is a key spice blend used in Indian cooking. Garam means warm in Hindi and masala refers to a blend of ground spices which includes cinnamon, cloves, cardamom, black pepper and cumin. Look for it in the ethnic or spice sections of your grocery store.</p>","id":"text-asset-3202","type":"text-asset","createdAt":1303141055,"contexts":[{"type":"node","node":"node-1931"}]},
    {"name":"sauce video_demo","body":"<p>Want to be the star of the grill this summer? Our Kraft Kitchens Food Expert can show you a tip on how basting with Kraft Barbecue and A1 steak sauces while your chicken or meat is on the grill can earn you rave reviews.</p>","id":"text-asset-3200","type":"text-asset","createdAt":1303139321,"contexts":[{"type":"node","node":"node-2006"}]},
    {"name":"steak video_demo","body":"<p>Getting perfectly cooked juicy steaks is easy once you know the basics. The Kraft Kitchens Expert will show you how to work the grill like a master and deliver mouth-watering steaks every time.</p>","id":"text-asset-3199","type":"text-asset","createdAt":1303139236,"contexts":[{"type":"node","node":"node-2007"}]},
    {"name":"burger basics_demo","body":"Summer and burgers go hand-in-hand. Now you can get a few quick tips &#13;\nfrom the Kraft Kitchens Expert that will spice up your burgers to &#13;\nperfection.","id":"text-asset-2935","type":"text-asset","createdAt":1302726692,"contexts":[{"type":"node","node":"node-2008"}]},
    {"name":"fast & easy grilling_demo","body":"<p>When youre grilling steak, timing is everything. Our Kraft Kitchens has easy tips on how long, per side, to cook thin and thick steaks, and the correct temperature for medium and well-done versions of your favorite cuts. </p>","id":"text-asset-3201","type":"text-asset","createdAt":1303140149,"contexts":[{"type":"node","node":"node-2009"}]},
    {"name":"boca burger_demo","body":"<p><strong>Make It</strong></p><ul><li>1 frozen <strong>BOCA Meatless Original Vegan Burger</strong></li><li>1 Tbsp.  <strong>ATHENOS Crumbled Blue Cheese</strong></li><li>1/2 cup shredded lettuce</li><li>1/4 cup  chopped tomatoes</li><li>Dash freshly ground black pepper</li><li>make it</li></ul><p><strong>COOK </strong>burger in skillet as directed on package, topping with cheese and covering skillet the last minute.</p><p><strong>COVER </strong>small plate with lettuce.</p><p><strong>TOP </strong>with burger and remaining ingredients.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>SUBSTITUTE </strong>Prepare using a frozen <strong>BOCA Meatless All American Flame Grilled Burger</strong>.</p><p><strong>SUBSTITUTE </strong>For a change of pace, substitute <strong>ATHENOS Traditional Crumbled Feta Cheese</strong> for the blue cheese.</p>","id":"text-asset-3203","type":"text-asset","createdAt":1303141744,"contexts":[{"type":"node","node":"node-2010"}]},
    {"name":"southwest burger_demo","body":"<strong>What You Need</strong><ul><li>1-1/2 lb. extra-lean ground beef</li><li>1/4 cup  <strong>KRAFT Light Mayo Reduced Fat</strong> Mayonnaise, divided</li><li>1 pkg. (1-1/4 oz.) <strong>TACO BELL\u00ae HOME ORIGINALS\u00ae Taco Seasoning Mix</strong></li><li>1/2 cup<strong>  KRAFT 2% Milk Shredded Colby &amp; Monterey Jack Cheeses</strong></li><li>1/4 cup <strong>TACO BELL\u00ae HOME ORIGINALS\u00ae Thick 'N Chunky Salsa</strong>, divided</li><li>6   whole wheat hamburger buns</li><li>6 lettuce leaves</li><li>1 large  tomato, cut into 6 slices</li></ul><strong>Make It</strong><p><strong>HEAT </strong>greased grill to medium-high heat.</p><p><strong>MIX </strong>meat, 3 Tbsp. mayo and seasoning mix; shape into 12 thin patties. Combine cheese and 2 Tbsp. salsa; spoon onto 6 patties. Cover with remaining patties; pinch edges to seal.</p><p><strong>GRILL </strong>7 min. on each side or until done (160\u00baF). Meanwhile, combine remaining salsa and mayo.</p><p><strong>FILL </strong>buns with lettuce, tomatoes, burgers and salsa mixture.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Make Ahead</strong>\u00a0Stuffed patties can be stored in refrigerator up to 4 hours before grilling as directed.</p><p><strong>Substitute\u00a0</strong>Substitute 93% lean ground turkey for the ground beef. </p>","id":"text-asset-3204","type":"text-asset","createdAt":1303142138,"contexts":[{"type":"node","node":"node-2011"}]},
    {"name":"inside out burger_demo","body":"<strong>What You Need</strong><ul><li>1 lb. ground beef</li><li>3 Tbsp.  <strong>KRAFT Ranch Dressing</strong>, divided</li><li>4 slices <strong>OSCAR MAYER Bacon</strong>, cooked, crumbled</li><li>2   <strong>KRAFT Singles</strong>, cut into quarters</li><li>4 hamburger buns, toasted</li><li>4   lettuce leaves</li><li>2 tomatoes, cut into 4 slices each</li></ul><strong>Make It</strong><p><strong>HEAT </strong>grill to medium heat.</p><p><strong>MIX </strong>meat and 2 Tbsp. dressing; shape into 8 thin patties. Combine remaining dressing and bacon. Spoon onto centers of 4 patties; top with Singles quarters and remaining patties. Pinch edges together to seal.</p><p><strong>GRILL </strong>7 to 9 min. on each side or until burgers are done (160\u00b0F).</p><p><strong>FILL </strong>buns with lettuce, burgers and tomatoes.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Serving Suggestion\u00a0</strong>Enjoy this summer favorite with grilled skewered vegetables.</p><p><strong>Substitute </strong>Substitute 1/3 cup<strong> KRAFT Shredded Cheddar</strong> or<strong> Monterey Jack Cheese</strong> for the Singles.</p><p><strong>Storing Ground Beef\u00a0</strong>Store ground beef in the coldest part of the refrigerator for up to 2 days. (The refrigerator temperature should be no higher than 40\u00b0F.) For longer storage, wrap the meat tightly in foil or freezer-weight plastic wrap and store in the freezer. When thawing, place the meat on the bottom shelf of the refrigerator to prevent any drippings from cross-contaminating other foods.</p>","id":"text-asset-3205","type":"text-asset","createdAt":1303142591,"contexts":[{"type":"node","node":"node-2012"}]},
    {"name":"foil fish_demo","body":"<strong>What You Need</strong><ul><li>4 sheets (12x18 inch each) <strong>REYNOLDS WRAP\u00ae EVERYDAY\u00ae Heavy Duty Aluminum Foil</strong></li><li>4   orange roughy, cod or sole fillets (4 oz. each), thawed if frozen</li><li>1/4 cup <strong>KRAFT Real Mayo Mayonnaise</strong></li><li>1/4 cup  <strong>KRAFT Grated Parmesan Cheese</strong></li><li>1/8 tsp. ground red pepper</li><li>2 medium  zucchini, sliced</li><li>1/2 of a medium red bell pepper, cut into strips</li></ul><p><strong>Make It</strong></p><p><strong>PREHEAT </strong>grill to medium-hot heat. Spray foil with cooking spray. Place 1 fish fillet in center of each sheet of foil. Spread fish evenly with mayo. Sprinkle with Parmesan cheese and ground red pepper; top with vegetables.</p><p><strong>BRING </strong>up foil sides. Double fold top and ends to seal packet, leaving room for heat circulation inside. Repeat to make 4 packets. Place on grill rack; cover grill with lid.</p><p><strong>GRILL </strong>10 to 12 minutes or until fish flakes easily with fork.</p><p><strong>Kraft Kitchens Tips</strong></p><p><strong>Special Extra\u00a0</strong>Garnish each serving with a lemon wedge.</p><p><strong>Serving Suggestion\u00a0</strong>Serve this flavorful entree with crusty Italian bread.</p><p><strong>Use Your Oven\u00a0</strong>Preheat oven to 450\u00b0F. Assemble foil packets as directed; place on baking sheet. Bake 18 to 22 minutes or until fish flakes easily with fork.</p>","id":"text-asset-3206","type":"text-asset","createdAt":1303143379,"contexts":[{"type":"node","node":"node-2013"}]},
    {"name":"berry drink_demo","body":"<strong>What You Need</strong><ul><li><strong>COUNTRY TIME Lemonade Flavor Drink Mix</strong></li><li>1/2 cup  water</li><li>1 cup fresh or frozen strawberries</li><li>3 cups  ice cubes</li></ul><p><strong>Make It</strong></p><p><strong>MEASURE </strong>drink mix into cap to 1-qt. line (1/2 cup).</p><p><strong>BLEND </strong>water, drink mix and berries in blender until smooth. Add ice; blend on high speed until thickened.</p><p><strong>SERVE </strong>immediately.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>SUBSTITUTE </strong>Substitute blueberries or sliced peeled peaches for the strawberries.</p>","id":"text-asset-3216","type":"text-asset","createdAt":1303148683,"contexts":[{"type":"node","node":"node-2014"}]},
    {"name":"tea cocktail_demo","body":"<strong>What You Need</strong><ul><li>1 pkt. (0.07 oz.) CRYSTAL LIGHT On The Go Natural Lemon Flavor Iced Tea Mix</li><li>1 pkts.  (0.06 oz.) CRYSTAL LIGHT On The Go Raspberry Ice Flavor Drink Mix</li><li>1 qt. (4 cups) cold water</li><li>1/4 cup  rum</li></ul><p><strong>Make It</strong></p><p><strong>STIR </strong>all ingredients in plastic or glass pitcher until drink mix is dissolved.</p><p><strong>SERVE </strong>over ice.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>SPECIAL EXTRA\u00a0</strong>Garnish with lemon slices and fresh mint sprigs just before serving.</p><p><strong>MAKE AHEAD</strong> Drink can be made ahead of time. Store in refrigerator until ready to serve.</p>","id":"text-asset-3217","type":"text-asset","createdAt":1303149009,"contexts":[{"type":"node","node":"node-2015"}]},
    {"name":"mojito_demo","body":"<strong>What You Need</strong><ul><li>6 fresh mint leaves</li><li>Ice cubes</li><li>1 pkt. (0.14 oz.) <strong>CRYSTAL LIGHT On The Go Lemonade Flavor Drink Mix</strong>, chilled</li><li>2 cups  water</li><li>1/2 cup diet carbonated lemon-lime beverage</li><li>1/4 cup  rum</li></ul><p><strong>Make It</strong></p><p><strong>PLACE </strong>2 mint leaves in each of 3 tall glasses. Use back of spoon to crush mint to release its flavor. Fill glasses with ice.</p><p><strong>MIX </strong>remaining ingredients in plastic or glass pitcher until drink mix is dissolved.</p><p><strong>POUR </strong>into glasses.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>NON-ALCOHOLIC VARIATION\u00a0</strong>Prepare drink as directed, omitting the rum and adding 2 drops rum extract to lemonade mixture before pouring into prepared glasses.</p><p><strong>SPECIAL EXTRA</strong> Garnish each filled glass with a lime slice.</p>","id":"text-asset-3218","type":"text-asset","createdAt":1303149305,"contexts":[{"type":"node","node":"node-2016"}]},
    {"name":"lemonade sangria_demo","body":"<strong>What You Need</strong><ul><li>1 pkt. CRYSTAL LIGHT On The Go Lemonade Flavor Drink Mix</li><li>1/3 cup  water</li><li>1/3 cup orange juice</li><li>1-1/3 cups  dry white wine</li><li>1 cup assorted fresh fruit (pitted cherries, seedless grapes, cut-up apples and peaches)</li></ul><p><strong>Make It</strong></p><p><strong>STIR </strong>all ingredients except fruit until drink mix is dissolved.</p><p><strong>REFRIGERATE </strong>2 hours or until chilled.</p><p><strong>SERVE </strong>over ice; top with fruit.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>RED LEMONADE SANGRIA</strong> Prepare as directed, substituting red wine for the white wine.</p><p><strong>NON-ALCOHOLIC VARIATION\u00a0</strong>Prepare as directed, substituting grape juice for the wine.</p><p><strong>HOW TO PREPARE A PITCHER OF SANGRIA\u00a0</strong>Prepare as directed, using 2 pkt. <strong>CRYSTAL LIGHT</strong>, 1 cup each water and orange juice, 1 bottle (750 mL) wine and 2 cups fruit. Makes 5 servings.</p>","id":"text-asset-3219","type":"text-asset","createdAt":1303149576,"contexts":[{"type":"node","node":"node-2017"}]},
    {"name":"triple citrus_demo","body":"<strong>What You Need</strong><ul><li>3-1/2 cups (28 oz.) cold water</li><li>1 pkt.  (.13 oz.) <strong>CRYSTAL LIGHT SUNRISE On The Go Classic Orange Flavor Drink Mix</strong></li><li>1 pkt. (.14 oz.) <strong>CRYSTAL LIGHT On The Go Lemonade Flavor Drink Mix</strong></li><li>1/2 cup  (4 oz.) tequila</li><li>2 Tbsp. (1 oz.) lime juice</li></ul><p><strong>Make It</strong></p><p><strong>ADD </strong>water to drink mixes in plastic or glass pitcher; stir until mixes are dissolved.</p><p><strong>STIR </strong>in tequila and lime juice.</p><p><strong>SERVE </strong>over ice cubes in tall glasses.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>SPECIAL EXTRA</strong> Serve in salt-rimmed glasses. Garnish each with a lime slice.\u00a0</p><p><strong>FROZEN TRIPLE-CITRUS MARGARITA</strong> Place all ingredients in blender. Add 1 cup ice cubes; blend on high speed until smooth. Pour into 4 glasses. Serve immediately.</p>","id":"text-asset-3220","type":"text-asset","createdAt":1303149810,"contexts":[{"type":"node","node":"node-2018"}]},
    {"name":"salmon_demo","body":"<p><strong>What You Need</strong></p><ul><li><strong>KRAFT THICK 'N SPICY Original Barbecue Sauce</strong></li><li>2 Tbsp.  brown sugar</li><li>1 green onion, sliced</li><li>4   salmon fillets or steaks (1 lb.)</li></ul><p><strong>Make It</strong></p><p><strong>HEAT </strong>greased grill to medium-high heat.</p><p><strong>MIX </strong>first 3 ingredients until well blended.</p><p><strong>GRILL </strong>fish 4 min. on each side; brush generously with barbecue sauce mixture. Grill 2 to 4 min. or until fish flakes easily with fork, turning occasionally and brushing with remaining sauce.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>SUBSTITUTE </strong>Prepare using halibut or swordfish steaks.</p><p><strong>USE YOUR BROILER</strong> Mix barbecue sauce mixture as directed. Place fish on rack of broiler pan. Broil, 4 inches from heat, 4 min. on each side. Brush generously with barbecue sauce mixture. Broil 2 to 4 min. or until fish flakes easily with fork, turning once and brushing occasionally with remaining sauce.</p><p><strong>SERVING SUGGESTION</strong> Serve with hot cooked rice.</p>","id":"text-asset-3225","type":"text-asset","createdAt":1303150767,"contexts":[{"type":"node","node":"node-2020"}]},
    {"name":"salmon ceder_demo","body":"<p><strong>What You Need</strong></p><ul><li>Untreated cedar plank (14x7x1 inch)</li><li>1/2 cup  <strong>KRAFT Sun Dried Tomato Vinaigrette Dressing</strong></li><li>1/4 cup finely chopped fresh parsley</li><li>1/4 cup  finely chopped oil-packed sun-dried tomatoes</li><li>1 Tbsp. oil</li><li>1   salmon fillet (2 lb.), 1-inch thick</li></ul><p><strong>Make It</strong></p><p><strong>IMMERSE </strong>plank in water, placing a weight on top of plank to keep it submerged. Soak 4 hours or overnight.</p><p><strong>HEAT </strong>grill to medium heat. Mix dressing, parsley and tomatoes; set aside. Brush top of plank with oil; top with fish. Place on grill; cover grill with lid.</p><p><strong>GRILL </strong>10 min. Brush fish with dressing mixture; grill 10 min. or until fish flakes easily with fork.</p><p><strong>Kraft Kitchen Tips</strong></p><p><strong>COOKING KNOW-HOW</strong>\u00a0Untreated cedar planks, which are sold for this purpose, can be found at most specialty food stores or some grocery stores. Keep a spray bottle of water close at hand if needed for flare-ups.</p><p><strong>NOTE </strong>Salmon can also be grilled on a sheet of heavy-duty foil instead of the cedar plank.</p>","id":"text-asset-3228","type":"text-asset","createdAt":1303151067,"contexts":[{"type":"node","node":"node-2021"}]},
    {"name":"Bulls Eye BBQ description","body":"<p>Barbecue sauces filled with artificial ingredients shouldn\u2019t have a home on your range. Or on your grill or in your oven, for that matter. Fortunately, there\u2019s one sauce out there that\u2019s more real.<br /><br />Bull\u2019s-Eye Barbecue Sauce delivers nothing but good, pure barbecue flavor across your menu. With high-quality ingredients in a ready-to-use format, Bull\u2019s-Eye makes it easy for you to serve up authentic taste on everything from entrees to appetizers to sandwiches.</p>","id":"text-asset-3380","type":"text-asset","createdAt":1303434980,"contexts":[{"type":"node","node":"node-2184"}]},
    {"name":"Kraft BBQ Sauce Description","body":"<p>When it comes to classic BBQ flavor, nothing beats Kraft brand BBQ Sauce. Available in the popular original flavor as well as a tangy hickory smoke variety, this is a griller's must have.\u00a0</p>","id":"text-asset-3381","type":"text-asset","createdAt":1303435524,"contexts":[{"type":"node","node":"node-2185"}]},
    {"name":"Kraft Parmesan chesse description","body":"Kraft grated parmesan, 16-ounce plastic canister (pack of 3), in the familiar green can, has been a part of the Italian meal tradition for over half a century. For millions of Americans, shaking on the grated Parmesan cheese is the finishing touch that signals permission to share good food in the company of those that you love.<a></a>","id":"text-asset-3382","type":"text-asset","createdAt":1303435638,"contexts":[{"type":"node","node":"node-2186"}]},
    {"name":"Kraft Singles Description","body":"<p>Kraft Singles are a sensible solution for adding cheese to your favorite sandwiches and burgers. They're also an excellent source of calcium, vitamin D and phosphorus.</p>","id":"text-asset-3383","type":"text-asset","createdAt":1303436027,"contexts":[{"type":"node","node":"node-2187"}]},
    {"name":"Zesty Italian Salad Dressing Description","body":"<p>Kraft's Zesty Italian Salad Dressing combines Italian herbs and spices with zesty lemon juice resulting in a delicious dressing that's a great addition to any salad or recipe. Try some today and bring the quality of Kraft to your kitchen.</p>","id":"text-asset-3384","type":"text-asset","createdAt":1303436127,"contexts":[{"type":"node","node":"node-2188"}]},
    {"name":"Miracle Whip Description","body":"<p>Miracle Whip salad dressing is known for its zesty taste and creamy consistency. Consumers all over the world use \u201cthe zip\u201d in different ways, including in dips, creamy potato and pasta salads, dressings and as a sandwich spread.</p>","id":"text-asset-3385","type":"text-asset","createdAt":1303436374,"contexts":[{"type":"node","node":"node-2189"}]},
    {"name":"Oscar Mayer Bacon Description","body":"<p>Naturally hardwood smoked. America's favorite. America's favorite brand of bacon is Oscar Mayer. Oscar Mayer has been making great tasting bacon for over 75 years. Our naturally hardwood smoked process brings out the delicious flavor and aroma that everyone loves. Oscar Mayer - nothing but the best!\u00a0</p>","id":"text-asset-3386","type":"text-asset","createdAt":1303436609,"contexts":[{"type":"node","node":"node-2190"}]},
    {"name":"Velveeta Description","body":"<p>Its the Creamiest cheese sauce and great with shell pasta. Only Velveeta Shells &amp; Cheese has the rich, creamy cheese sauce that makes your everyday meals special. This product can be part of a wholesome meal and it is an excellent source of calcium an protein, and a good source of iron.</p>","id":"text-asset-3387","type":"text-asset","createdAt":1303436945,"contexts":[{"type":"node","node":"node-2191"}]},
    {"name":"about HIV concert_demo","body":"<p><strong>The City of Houston Department of Health</strong> and Human Services and <a href=\"http://theboxhouston.com/\" title=\"97.9 The Box\">97.9 The Box</a> have teamed up again this year to host the 4th Annual HIP HOP for HIV Awareness Campaign and Concert.</p><p>How do you get a ticket to the summer's hottest hip hop concert? It easy. Join us Monday through Thursday at Greenspoint Mall and get screened for and educated on HIV and other STD's. To get tested, you have to be at least 13 years of age and have some form of identification ( school ID or drivers license preferred).\u00a0</p><p>Testing is absolutely FREE and you will get your status on the same day. Know your status. You are worth it.</p>","id":"text-asset-2708","type":"text-asset","createdAt":1302540368,"contexts":[{"type":"node","node":"node-13940"},{"type":"node","node":"node-13933"}]}
